import React from 'react';
import './navBar.css'
import {MenuItems} from './menuItem'

function NavBar (){
        return(
            <nav className='navbarItems'>
                <h1 className='navbar-logo'>
                Expert Republic
                </h1>
                    <ul>
                        {MenuItems.map((item, index) => {
                            return (
                                <li key={index}>
                                    <a className></a>Browse
                                    </li>
                            )
                        })}

                        <li>About</li>
                        <li>Blog</li>
                        <li>Enterprise</li>
                        <li>Reach out</li>
                        <li>Become an Expert</li>
                        <li>Browse</li>
                    </ul>
            </nav>
        );
    }

export default NavBar;

